Belladonna, Ashley Blue, Rebeca Linares, Jada Fire, Katja Kassin, John Strong, Mark Wood, Tony T., Sasha, Kurt Lockwood.

Finally, the second installment of Belladonna's Manhandled series! She pulls out all the stops on this one... Belladonna gets pummeled in a DP with Mark Wood and John Strong! She claims, &quot;One my best DPs yet!&quot; Rebeca tries her hand at competing with the same two men! Wait until you see her smoking performance! Jada Fire doesn't understand a word of German, but she doesn't need to.. Sascha, the German Shepherd takes control and never lets up! Bella comes back for round two. In an intimate scene with her crush, Tony T! Katja finally catches that creepy shoe stealer and gives him a run for his &quot;money&quot;! It doesn't get better than this... until Part 3!
